import React, {Component} from "react";
import {Table,Card,Button} from 'antd';
import { Link } from 'react-router-dom'
import axios from '../../axios'
let meetdata = [];

const columns = [{
    title: '开始时间',
    dataIndex: 'RoomName',
   
    width: '20%',
    align:'center'
}, {
    title: '会议主题',
    dataIndex: 'appName',
    width: '20%',
    align:'center'
}, {
    title: '会议号',
        dataIndex: 'appName',
    align:'center'
}, {
    title: '状态',
        dataIndex: 'appName',
    align:'center'
},
    {
        title: '操作',
        dataIndex: 'id',
        align:'center'
    }
]

class MeetList extends Component {
  

    constructor(props) {
        super(props)
        this.state = {}
    }

    componentDidMount() {

        var params = { page: 1 };
        this.getMeetData(params);

    }

    getMeetData(params) {
        axios.getMeetList().then((res) => {
            console.log(res)
            meetdata = res.response.data;
          
            console.log(meetdata)

        })
    }


    render() {

        return (
            <Card title="会议列表"  >
                <Table bordered
                    dataSource={meetdata}
                   columns={columns}
                   pagination={{ position: ['none', 'bottomRight'] }}
            > </Table>
            </Card>
        )
    }
}

export default MeetList
